import "./Settings.modal.css";
const Settings = () => {
  return (
    <div className="settings">
      <h6>Shop filter</h6>
      <input type="radio" />
      <label>Tech filter</label>
      <h6 type="radio" />
      <label>Rest filter</label>
      <input type="radio" />
    </div>
  );
};

export default Settings;
